import React from "react";
import Common from "./Common";

function About() {
  const aboutHead = () => {
    <h1>
      Interior your house with
      <strong className="brand-name"> InterioDesign</strong>
    </h1>;
  };
  return (
    <div>
      <Common aboutHeading={about} />
    </div>
  );
}

export default About;
